                            <Col>
                                <ProductCard />
                            </Col>
                            <Col>
                                <ProductCard />
                            </Col>
                            <Col>
                                <ProductCard />
                            </Col>
                            <Col>
                                <ProductCard />
                            </Col>
                        </Row>
                        <h3 className="mt-5 mb-5 display-4">Home Appliances</h3>
                        <Row>
                            <Col>
                                <ProductCard />
                            </Col>
                            <Col>
                                <ProductCard />
                            </Col>
                            <Col>
